import { Component } from '@angular/core';
import { Camera, CameraOptions } from '@ionic-native/camera';
import {PhotoViewer} from '@ionic-native/photo-viewer';
import {DomSanitizer} from '@angular/platform-browser';
/**
 * Generated class for the PictureComponent component.
 *
 * See https://angular.io/docs/ts/latest/api/core/index/ComponentMetadata-class.html
 * for more info on Angular Components.
 */
@Component({
  selector: 'picture-viewer',
  templateUrl: 'picture-viewer.html'
})
export class PictureViewerComponent {

  text: string;
  imageData: string = '';
  options: CameraOptions = {
    quality: 100,
    destinationType: this.camera.DestinationType.DATA_URL,
    encodingType: this.camera.EncodingType.JPEG,
    mediaType: this.camera.MediaType.PICTURE,
    allowEdit: false,
    saveToPhotoAlbum: false,
    correctOrientation: true,
    targetWidth: 680,
    targetHeight: 680,
  }

  get imageUrl(){
    return this.imageData == null
      ? ""
      : this.sanitizer.bypassSecurityTrustUrl('data:image/jpeg;base64,' + this.imageData);
  }

  constructor(
    private camera: Camera,
    private photoViewer: PhotoViewer,
    private sanitizer: DomSanitizer)
  {
    console.log('Hello PictureComponent Component');
    this.text = 'Hello World';
  }

  selectPicture() {
    let options = this.options;
    options.sourceType = this.camera.PictureSourceType.PHOTOLIBRARY;
    this.getPicture(options);
  }

  takeNewPicture() {
    let options = this.options;
    options.sourceType = this.camera.PictureSourceType.CAMERA;
    this.getPicture(options);
  }

  onClickPicture() {
    try {
      alert('on clickkkkk');
    //  this.photoViewer.show(this.imageUrl, "Plan d'implantation");
    }
    catch(error)
    {
      alert(JSON.stringify(error));
    }
  }

  private getPicture(options: CameraOptions) {
    try {

      this.camera.getPicture(options).then((imageData) => {
        // imageData is either a base64 encoded string or a file URI
        // If it's base64:
        this.imageData = imageData;
        // let base64Image = 'data:image/jpeg;base64,' + imageData;
      }, (err) => {
        alert(err);
      });
    }
    catch(error)
    {
      alert(JSON.stringify(error));
    }
  }
}
